EDITORIAL REVIEW FROM AMAZON:

Product Description
After working for 10 years to develop my method, I have turned down every opportunity to have it reach the masses - until now. I have figured out an effective way to take everyone on the life-changing journey that my method has to offer. This DVD will help you get the kind of results that I know you never thought were possible. My Dance Cardio DVD is a follow up to last year's Dance Aerobics DVD and it is full of new combinations. It features a break down section so that you can learn the routines at your own pace and you will have the exciting option of following me from the back just as if you were in the class with me. Dance Cardio is the perfect complement to the muscular structure work of the Mat Workout DVD. Take the time to get good at the moves featured in these DVDs and they will be all that you need to be on your way to a life free from wondering if you are doing the &quot;right&quot; exercise to get the body you want.

